import React from 'react';
import MyChart from './MyChart';
import { useNavigate } from 'react-router-dom';
import './components/main.css';
import './components/src/profile.png';
const MainMenu = () => {
  const navigate = useNavigate();

  return (
    <div className="main-container">
      <header className="header">
        <div className="dropdown-container">
          <select className="dropdown">
            <option>Assign Conductor</option>
            <option>Conductor 1</option>
            <option>Conductor 2</option>
          </select>
          <select className="dropdown">
            <option>Assign Inspector</option>
            <option>Inspector 1</option>
            <option>Inspector 2</option>
          </select>
        </div>
        <div className="profile-container" onClick={() => navigate('/profile')}>
          <img src="./src/profile.png" alt="Profile" className="profile-pic" />
        </div>
      </header>

      <div className="cards-container">
        <div className="card">
          <MyChart />
        </div>
        <div className="card calendar-card">
          <h3>Calendar</h3>
          <iframe 
            title="Google Calendar"
            src="https://calendar.google.com/calendar/embed?..." 
            style={{ border: '0', width: '100%', height: '100%' }} 
          ></iframe>
        </div>
      </div>
    </div>
  );
};

export default MainMenu;
